s \"Inactive\" on \"Exchange\" page\n#    Then I verify \"Review & confirm\" step is \"Active\" on \"Exchange\" page\n    When I \"check\" consent checkbox on Exchange page\n    Then I review Exchange summary for \"<buyCurrency>\" corridor and \"<buyAmount>\" amount\n    #Then I create test data file with Exchange transaction details\n    When I Confirm the Exchange transaction\n    Then I verify details on Exchange Success modal popup\n    When I click \"Done\" button on Exchange Success modal popup\n    Then I verify Dashboard page is displayed\n    Then I navigate to Transactions tab page\n    Then I verify transaction status \"Ordered\" in table and open transaction details view\n    Then I verify exchange transaction status is \"Ordered\" on transaction details view\n    Then I verify details of exchange transaction on transaction details view\n    When I close the transaction details view\n    Then I navigate to Wallets tab page\n    Then I verify available funds for the \"<buyCurrency>\" corridor\n    Then I verify available funds for the \"AED\" corridor\n    When I'm Sign out from the Corp portal\n#    Given I'm Logged in to the Ops portal\n##    Then I navigated to the \"Transactions\" page using left navigation\n##    When I open transaction details view of the \"<transactionType>\" transaction having \"<transactionReference>\"\n##    Then I navigate to Customer Overview page from the transaction details view\n###    Then I search for customer by \"Phone number\" \"<phone>\" in the Customers page\n#    Then I open customer overview page of customer registered with \"Phone number\" \"<phone>\"\n#    And I verify \"Available\" balance of \"<buyCurrency>\" wallet on the Customer Overview page\n#    And I verify \"Available\" balance of \"AED\" wallet on the Customer Overview page\n#    When I navigate to \"Wallet debits\" tab page\n##    Then I search for the transaction with \"<reference>\", \"<type>\" and \"<status>\"\n#    When I open transaction details   @corp\n  Scenario Outline: Verify the end to end flow of Exchange flow for EUR corridor\n    Given I'm Logged in to the Corp portal\n    Then I verify Dashboard page is displayed\n    Then I Note the wallet balance for the \"<buyCurrency>\" corridor\n    Then I navigate to Exchange page\n    Then I verify default details on Exchange page\n    Then I verify \"Hubpay\" company name and \"Sreekanth\" full name on Exchange page\n    Then I verify \"Amount\" step is \"Active\" on Exchange page\n    Then I verify \"Review & confirm\" step is \"Inactive\" on Exchange page\n    When I select \"<buyCurrency>\" corridor and input \"<buyAmount>\" amount on Exchange page\n    Then I verify Live rate is displayed for \"<buyCurrency>\" corridor\n    Then I verify \"<processingTime>\" for the \"<buyCurrency>\" corridor\n#    Then I verify Settlement Date for the \"<currency>\" corridor\n    When I click \"Next\" button on Exchange page\n    Then I verify \"Amount\" step is \"Inactive\" on Exchange page\n    Then I verify \"Review & confirm\" step is \"Active\" on Exchange page\n    When I \"check\" consent checkbox on Exchange page\n    Then I review Exchange summary for \"<buyCurrency>\" corridor and \"<buyAmount>\" amount\n    #Then I create test data file with Exchange transaction details\n    When I Confirm the Exchange transaction\n    Then I verify details on Exchange Success modal popup\n    When I click \"Done\" button on Exchange Success modal popup\n    Then I verify Dashboard page is displayed\n    Then I navigate to Transactions tab page\n    Then I verify transaction status \"Ordered\" in table and open transaction details view\n    Then I verify exchange transaction status is \"Ordered\" on transaction details view\n    Then I verify details of exchange transaction on transaction details view\n    When I close the exchange transaction details view\n    Then I navigate to Wallets tab page\n    Then I verify available funds for the \"<buyCurrency>\" corridor\n    Then I verify available funds for the \"AED\" corridor\n    When I'm Sign out from the Corp portal\n    Given I'm Logged in to the Ops portal\n#    Then I navigated to the \"Transactions\" page using left navigation\n#    When I open transaction details view of the \"<transactionType>\" transaction having \"<transactionReference>\"\n#    Then I navigate to Customer Overview page from the transaction details view\n##    Then I search for customer by \"Phone number\" \"<phone>\" in the Customers page\n    Then I open customer overview page of customer registered with \"Phone number\" \"<phone>\"\n    And I verify \"Available\" balance of \"<buyCurrency>\" wallet on the Customer Overview page\n    And I verify \"Available\" balance of \"AED\" wallet on the Customer Overview page\n    When I navigate to \"Wallet debits\" tab page\n#    Then I search for the transaction with \"<reference>\", \"<type>\" and \"<status>\"\n    When I open transaction details view of the \"<transactionType>\" transaction having \"<transactionReference>\"\n    Then I verify transaction \"Ordered\" on the transaction details view\n    Then I verify \"<transactionType>\" details on the transaction details view\n    Then I verify \"SETTLEMENT RECEIVED\" button \"Available\" on the transaction details view\n    When I click \"SETTLEMENT RECEIVED\" button on the transaction details view\n    Then I verify \"SETTLE\" button \"Available\" on the transaction details view\n    Then I verify transaction \"ORDER_SETTLED\" on the transaction details view\n    Then I verify \"<transactionType>\" details on the transaction details view\n    Then I navigate to Customer Overview page from the transaction details view\n    And I verify \"Available\" balance of \"<buyCurrency>\" wallet on the Customer Overview page\n    Then I calculate and update wallet balance in test data file\n    And I verify \"Available\" balance of \"AED\" wallet after submitting Foreign Exchange to CAB\n    Given I'm Logged in to the Corp portal\n    Then I verify Dashboard page is displayed\n    Then I verify available funds for the \"AED\" corridor after submitting Foreign Exchange to CAB\n    And I verify available funds for the \"<buyCurrency>\" corridor\n    Then I navigate to Transactions tab page\n    Then I verify transaction status \"Settled\" in table and open transaction details view\n    Then I verify exchange transaction status is \"Order Settled\" on transaction details view\n    Then I verify details of exchange transaction on transaction details view\n    When I close the exchange transaction details view\n    When I'm Sign out from the Corp portal\n    Given I'm Logged in to the Ops portal\n    Then I navigated to the \"Transactions\" page using left navigation\n    When I open transaction details view of the \"<transactionType>\" transaction having \"<transactionReference>\"\n    When I click \"SETTLE\" button on the transaction details view\n    Then I verify transaction \"COMPLETED\" on the transaction details view\n    Then I verify \"<transactionType>\" details on the transaction details view\n    Then I navigate to Customer Overview page from the transaction details view\n    And I verify \"Available\" balance of \"AED\" wallet after submitting Foreign Exchange to CAB\n    And I verify \"Available\" balance of \"<buyCurrency>\" wallet after submitting Foreign Exchange to CAB\n    Given I'm Logged in to the Corp portal\n    Then I verify Dashboard page is displayed\n    Then I verify available funds for the \"<buyCurrency>\" corridor after submitting Foreign Exchange to CAB\n    Then I verify available funds for the \"AED\" corridor after submitting Foreign Exchange to CAB\n    Then I navigate to Transactions tab page\n    Then I verify transaction status \"Completed\" in table and open transaction details view\n    Then I verify exchange transaction status is \"Completed\" on transaction details view\n    Then I verify details of exchange transaction on transaction details view\n    When I close the exchange transaction details view\n    When I'm Sign out from the Corp portal\n\n    Examples:\n      | buyCurrency | buyAmount | processingTime | phone          | transactionType  | transactionReference |\n      | EUR         | 100.00     | Instant        | +91 7989730020 | Foreign Exchange |                      |","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/kanthreddy/wip/Hubpay_QAAutomation/src/test/resources/features/ExchangeFlow_EUR.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@exchange","id":"79dd86e1-c9e3-4932-8528-4b49f67dc64a"},{"location":{"line":1,"column":11},"name":"@eur","id":"cf5962f1-6d98-41de-9cea-5c73f1ad8cac"}],"language":"en","keyword":"Feature","name":"End to End Exchange flow - EUR","description":"","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"I setup test data file name for \"ForeignExchange\" \"EUR\" \"100\"","id":"6a0a4bc0-ad15-441e-95ee-db978aa6fb1d"}],"id":"b8c77116-0c48-40da-8b6e-6c72bac15f2a"}},{"scenario":{"location":{"line":8,"column":3},"tags":[{"location":{"line":7,"column":3},"name":"@corp","id":"3e1fd82c-1e7e-4477-8bad-f64813199dba"}],"keyword":"Scenario Outline","name":"Verify the end to end flow of Exchange flow for EUR corridor","description":"","steps":[{"location":{"line":9,"column":5},"keyword":"Given ","keywordType":"Context","text":"I'm Logged in to the Corp portal","id":"06b3cc03-9284-497c-abef-3a8e8bf6a4b8"},{"location":{"line":10,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"I verify Dashboard page is displayed","id":"2896bde6-7302-42ff-a46c-566e26b8adda"},{"location":{"line":11,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"I Note the wallet balance for the \"<buyCurrency>\" corridor","id":"3885d5da-9afa-4994- flow for GBP corridor\n    Given I'm Logged in to the Corp portal\n    Then I verify Dashboard page is displayed\n    Then I Note the wallet balance for the \"<buyCurrency>\" corridor\n    Then I navigate to Exchange page\n    Then I verify default details on Exchange page\n    Then I verify \"ANITHA TEST BUSINESS Solutions Private Limited\" company name and \"SRIKANTH PALLA BHANUMURTHY REDDY\" full name on Exchange page\n    Then I verify \"Amount\" step is \"Active\" on Exchange page\n    Then I verify \"Review & confirm\" step is \"Inactive\" on Exchange page\n    When I select \"<buyCurrency>\" corridor and input \"<buyAmount>\" amount on Exchange page\n    Then I verify Live rate is displayed for \"<buyCurrency>\" corridor\n    Then I verify \"<processingTime>\" for the \"<buyCurrency>\" corridor\n#    Then I verify Settlement Date for the \"<currency>\" corridor\n    When I click \"Next\" button on Exchange page\n    Then I verify \"Amount\" step is \"Inactive\" on Exchange page\n    Then I verify \"Review & confirm\" step is \"Active\" on Exchange page\n    When I \"check\" consent checkbox on Exchange page\n    Then I review Exchange summary for \"<buyCurrency>\" corridor and \"<buyAmount>\" amount\n    #Then I create test data file with Exchange transaction details\n    When I Confirm the Exchange transaction\n    Then I verify details on Exchange Success modal popup\n    When I click \"Done\" button on Exchange Success modal popup\n    Then I verify Dashboard page is displayed\n    Then I navigate to Transactions tab page\n    Then I verify transaction status \"Ordered\" in table and open transaction details view\n    Then I verify exchange transaction status is \"Ordered\" on transaction details view\n    Then I verify details of exchange transaction on transaction details view\n    When I close the exchange transaction details view\n    Then I navigate to Wallets tab page\n    Then I verify available funds for the \"<buyCurrency>\" corridor\n    Then I verify available funds for the \"AED\" corridor\n    When I'm Sign out from the Corp portal\n    Given I'm Logged in to the Ops portal\n#    Then I navigated to the \"Transactions\" page using left navigation\n#    When I open transaction details view of the \"<transactionType>\" transaction having \"<transactionReference>\"\n#    Then I navigate to Customer Overview page from the transaction details view\n##    Then I search for customer by \"Phone number\" \"<phone>\" in the Customers page\n    Then I open customer overview page of customer registered with \"Phone number\" \"<phone>\"\n    And I verify \"Available\" balance of \"<buyCurrency>\" wallet on the Customer Overview page\n    And I verify \"Available\" balance of \"AED\" wallet on the Customer Overview page\n    When I navigate to \"Wallet debits\" tab page\n#    Then I search for the transaction with \"<reference>\", \"<type>\" and \"<status>\"\n    When I open transaction details view of the \"<transactionType>\" transaction having \"<transactionReference>\"\n    Then I verify transaction \"Ordered\" on the transaction details view\n    Then I verify \"<transactionType>\" details on the transaction details view\n    Then I verify \"SETTLEMENT RECEIVED\" button \"Available\" on the transaction details view\n    When I click \"SETTLEMENT RECEIVED\" button on the transaction details view\n    Then I verify \"SETTLE\" button \"Available\" on the transaction details view\n    Then I verify transaction \"ORDER_SETTLED\" on the transaction details view\n    Then I verify \"<transactionType>\" details on the transaction details view\n    Then I navigate to Customer Overview page from the transaction details view\n    And I verify \"Available\" balance of \"<buyCurrency>\" wallet on the Customer Overview page\n    Then I calculate and update wallet balance in test data file\n    And I verify \"Available\" balance of \"AED\" wallet after submitting Foreign Exchange to CAB\n    Given I'm Logged in to the Corp portal\n    Then I verify Dashboard page is displayed\n    Then I verify available funds for the \"AED\" corridor after submitting Foreign Exchange to CAB\n    And I verify available funds for the \"<buyCurrency>\" corridor\n    Then I navigate to Transactions tab page\n    Then I verify transaction status \"Settled\" in table and open transaction details view\n    Then I verify exchange transaction status is \"Order Settled\" on transaction details view\n    Then I verify details of exchange transaction on transaction details view\n    When I close the exchange transaction details view\n    When I'm Sign out from the Corp portal\n    Given I'm Logged in to the Ops portal\n    Then I navigated to the \"Transactions\" page using left navigation\n    When I open transaction details view of the \"<transactionType>\" transaction having \"<transactionReference>\"\n    When I click \"SETTLE\" button on the transaction details view\n    Then I verify transaction \"COMPLETED\" on the transaction details view\n    Then I verify \"<transactionType>\" details on the transaction details view\n    Then I navigate to Customer Overview page from the transaction details view\n    And I verify \"Available\" balance of \"AED\" wallet after submitting Foreign Exchange to CAB\n    And I verify \"Available\" balance of \"<buyCurrency>\" wallet after submitting Foreign Exchange to CAB\n    Given I'm Logged in to the Corp portal\n    Then I verify Dashboard page is displayed\n    Then I verify available funds for the \"<buyCurrency>\" corridor after submitting Foreign Exchange to CAB\n    Then I verify available funds for the \"AED\" corridor after submitting Foreign Exchange to CAB\n    Then I navigate to Transactions tab page\n    Then I verify transaction status \"Completed\" in table and open transaction details view\n    Then I verify exchange transaction status is \"Completed\" on transaction details view\n    Then I verify details of exchange transaction on transaction details view\n    When I close the exchange transaction details view\n    When I'm Sign out from the Corp portal\n\n    Examples:\n      | buyCurrency | buyAmount | processingTime | phone          | transactionType  | transactionReference |\n      | GBP         | 10.00     | Instant        | +91 7989730020 | Foreign Exchange |                      |","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/kanthreddy/wip/Hubpay_QAAutomation/src/test/resources/features/ExchangeFlow_GBP.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@exchange","id":"7c26137d-6611-4489-a0d1-57e8fbb3a754"},{"location":{"line":1,"column":11},"name":"@gbp","id":"701b2afa-3611-4289-84b5-e71dc45d0218"}],"language":"en","keyword":"Feature","name":"End to End Exchange flow - GBP","description":"","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"I setup test data file name for \"ForeignExchange\" \"GBP\" \"10\"","id":"1dcd7fab-6a08-44a8-bf57-3dbe19ea739f"}],"id":"997a8cc8-6de8-4d9b-949c-92f9a6eac7bb"}},{"scenario":{"location":{"line":8,"column":3},"tags":[{"location":{"line":7,"column":3},"name":"@corp","id":"1c662014-59bd-4cc9-9d79-24d3f37d59c5"}],"keyword":"Scenario Outline","name":"Verify the end to end flow of Exchange flow for GBP corridor","description":"","steps":[{"location":{"line":9,"column":5},"keyword":"Given ","keywordType":"Context","text":"I'm Logged in to the Corp portal","id":"608a9b84-e31d-4841-bf36-73bdb71d551a"},{"location":{"line":10,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"I verify Dashboard page is displayed","id":"2b71e96c-e3fa-47c0-b368-0e03bb84581d"},{"location":{"line":11,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"I Note the wallet balance for the \"<buyCurrency>\" corridor","id":"ef236a1f-1d33-4ece-b560-e9 le name for \"Payments_Single\" \"AUD\" \"30\"\n\n  @corp\n  Scenario Outline: Verify the end to end flow of Exchange flow for AUD corridor\n    Given I'm Logged in to the Corp portal\n    Then I verify Dashboard page is displayed\n    Then I Note the wallet balance for the \"<currency>\" corridor\n    Then I navigate to Payments page\n    Then I verify default details on Payments page\n    Then I verify \"ANITHA TEST BUSINESS Solutions Private Limited\" company name and \"Sreekanth j\" full name on the page\n    Then I verify \"Wallet\" step is \"Active\" on \"Payments\" page\n    Then I verify \"Payments & Recipients\" step is \"Inactive\" on \"Payments\" page\n    Then I verify \"Review & confirm\" step is \"Inactive\" on \"Payments\" page\n    When I select \"<currency>\" corridor on Payments page\n    When I verify \"<currency>\" corridor details on Payments page\n    Then I verify \"<processingTime>\" for the \"<currency>\" Payments\n#    Then I verify Settlement Date for the \"<currency>\" corridor\n    When I click \"Next\" button on \"Payments\" page\n    Then I verify \"Wallet\" step is \"Inactive\" on \"Payments\" page\n    Then I verify \"Payments & Recipients\" step is \"Active\" on \"Payments\" page\n    Then I verify \"Review & confirm\" step is \"Inactive\" on \"Payments\" page\n#    Then I verify default details in Payments & Recipients step on \"Payments\" page\n    When I click \"Add individual or business\" button on \"Payments\" page\n    Then I verify Add a new recipient form is displayed\n    When I choose \"<recipientType>\" on Add a new recipient form\n    When I enter \"<recipientType>\" recipient details on Add a new recipient form\n    When I click \"Next\" button on Add a new recipient form\n    Then I verify \"<recipientType>\" details in row \"1\" in Recipients grid on Payments & Recipients step\n#    Then I verify \"<recipientType>\" recipient details in Payments & Recipients step on \"Payments\" page\n    Then I calculate the payment details for the recipients added\n    Then I verify payment details under checkout section in Payments & Recipients step on \"Payments\" page\n    When I click \"Checkout\" button on \"Payments\" page\n    Then I verify \"Wallet\" step is \"Inactive\" on \"Payments\" page\n    Then I verify \"Payments & Recipients\" step is \"Inactive\" on \"Payments\" page\n    Then I verify \"Review & confirm\" step is \"Active\" on \"Payments\" page\n    Then I verify payment details in Review & confirm step on \"Payments\" page\n    Then I verify \"<processingTime>\" for the \"<currency>\" Payments\n##    Then I verify settlement date in Review & confirm step on \"Payments\" page\n    When I click \"Confirm payment\" button on \"Payments\" page\n    Then I verify details on the Payment submitted page\n    When I navigate to Dashboard page\n    Then I navigate to Transactions tab page\n    Then I search and verify payment for \"<recipientType>\" in the Transactions grid\n#    Then I verify transaction status \"Scheduled\" in table and open transaction details view\n#    Then I verify payment transaction status is \"Ordered\" on transaction details view\n#    Then I verify details of payment transaction on transaction details view\n#    When I close the \"payment\" transaction details view\n#    Then I navigate to Wallets tab page\n#    Then I verify available funds for the \"<currency>\" corridor\n#    When I'm Sign out from the Corp portal\n\n#\n#    Given I'm Logged in to the Ops portal\n##    Then I navigated to the \"Transactions\" page using left navigation\n##    When I open transaction details view of the \"<transactionType>\" transaction having \"<transactionReference>\"\n##    Then I navigate to Customer Overview page from the transaction details view\n###    Then I search for customer by \"Phone number\" \"<phone>\" in the Customers page\n#    Then I open customer overview page of customer registered with \"Phone number\" \"<phone>\"\n#    And I verify \"Available\" balance of \"<currency>\" wallet on the Customer Overview page\n#    And I verify \"Available\" balance of \"AED\" wallet on the Customer Overview page\n#    When I navigate to \"Wallet debits\" tab page\n##    Then I search for the transaction with \"<reference>\", \"<type>\" and \"<status>\"\n#    When I open transaction details view of the \"<transactionType>\" transaction having \"<transactionReference>\"\n#    Then I verify transaction \"Ordered\" on the transaction details view\n#    Then I verify \"<transactionType>\" details on the transaction details view\n#    Then I verify \"SETTLEMENT RECEIVED\" button \"Available\" on the transaction details view\n#    When I click \"SETTLEMENT RECEIVED\" button on the transaction details view\n#    Then I verify \"SETTLE\" button \"Available\" on the transaction details view\n#    Then I verify transaction \"ORDER_SETTLED\" on the transaction details view\n#    Then I verify \"<transactionType>\" details on the transaction details view\n#    Then I navigate to Customer Overview page from the transaction details view\n#    And I verify \"Available\" balance of \"<currency>\" wallet on the Customer Overview page\n#    Then I calculate and update wallet balance in test data file\n#    And I verify \"Available\" balance of \"AED\" wallet after submitting Foreign Exchange to CAB\n#    Given I'm Logged in to the Corp portal\n#    Then I verify Dashboard page is displayed\n#    Then I verify available funds for the \"AED\" corridor after submitting Foreign Exchange to CAB\n#    And I verify available funds for the \"<currency>\" corridor\n#    Then I navigate to Transactions tab page\n#    Then I verify transaction status \"Settled\" in table and open transaction details view\n#    Then I verify exchange transaction status is \"Order Settled\" on transaction details view\n#    Then I verify details of exchange transaction on transaction details view\n#    When I close the exchange transaction details view\n#    When I'm Sign out from the Corp portal\n#    Given I'm Logged in to the Ops portal\n#    Then I navigated to the \"Transactions\" page using left navigation\n#    When I open transaction details view of the \"<transactionType>\" transaction having \"<transactionReference>\"\n#    When I click \"SETTLE\" button on the transaction details view\n#    Then I verify transaction \"COMPLETED\" on the transaction details view\n#    Then I verify \"<transactionType>\" details on the transaction details view\n#    Then I navigate to Customer Overview page from the transaction details view\n#    And I verify \"Available\" balance of \"AED\" wallet after submitting Foreign Exchange to CAB\n#    And I verify \"Available\" balance of \"<currency>\" wallet after submitting Foreign Exchange to CAB\n#    Given I'm Logged in to the Corp portal\n#    Then I verify Dashboard page is displayed\n#    Then I verify available funds for the \"<currency>\" corridor after submitting Foreign Exchange to CAB\n#    Then I verify available funds for the \"AED\" corridor after submitting Foreign Exchange to CAB\n#    Then I navigate to Transactions tab page\n#    Then I verify transaction status \"Completed\" in table and open transaction details view\n#    Then I verify exchange transaction status is \"Completed\" on transaction details view\n#    Then I verify details of exchange transaction on transaction details view\n#    When I close the exchange transaction details view\n#    When I'm Sign out from the Corp portal\n\n    Examples:\n      | currency | buyAmount | processingTime | phone          | transactionType  | recipientType|\n      | AUD         | 30.00     | Instant        | +91 7989730020 | Foreign Exchange |  BUSINESS                    |","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/kanthreddy/wip/Hubpay_QAAutomation/src/test/resources/features/LocalPaymentFlow_AUD.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1
